const PostList = (props) => {
  const renderPosts = () => {
    return props.posts.map((post) => {
      return <li>{post.name}</li>;
    });
  };
  return (
    <section>
      <h2>Listados de post</h2>
      <ul> {renderPosts()}</ul>
    </section>
  );
};
export default PostList;
